import React, { Component } from 'react'

export default class SidePanel extends Component {
    render() {
        return (
            <nav className="nav flex-column float-lg-right float-md-right float-xl-right">
                <a className="nav-link active" href="google.com"><i className="fas fa-newspaper mr-2"></i> Noticias</a>
                <a className="nav-link" href="google.com"><i className="fab fa-facebook-messenger mr-3"></i>Mensajería</a>
                <a className="nav-link" href="google.com"><i className="fas fa-store mr-3"></i>Marketplace</a>
                
                <a className="nav-link active" href="google.com"><i class="fas fa-users mr-3"></i>Grupos</a>
                <a className="nav-link" href="google.com"><i className="fas fa-flag m-1 mr-3"></i>Páginas</a>
                <a className="nav-link" href="google.com">Eventos</a>                
                <a className="nav-link" href="google.com">Guardado</a>
            </nav>
        )
    }
}
